Being a mama home with the kids it is nice to have some grab and go meals that are organic and kid friendly!! 🤝🏼

@sprouts is our favorite local market for all things raw and organic including our fave @eatsnowdays 🍕

snow days are perfect quick lunch/dinner or snack if your kids are anything like mine!!! 

